INSERT INTO `block_custom` (`bid`, `body`, `info`, `format`) VALUES
(1, '<div class="row">\r\n<section class="twelve columns">\r\n<h1>Integral Property Management</h1>\r\n<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi massa velit, consequat ut luctus eget, elementum interdum est. Proin eu tincidunt elit. Nunc dapibus ipsum eros, non placerat sem ultrices sit amet. Suspendisse semper gravida est. Etiam sit amet ante erat.</p>\r\n</section>  \r\n</div>\r\n<div class="glow">\r\n<div class="bg-integral_pm">\r\n</div>\r\n</div>\r\n<div class="bg-lines"></div>', 'integral-property-management', 'full_html'),
(2, '<div class="row">\r\n<section class="twelve columns">\r\n<h1>Misión</h1>\r\n<p>Phasellus quis nulla turpis. Aliquam sed sapien sed mauris congue commodo. Ut eget condimentum velit. Maecenas eu eros condimentum, porta felis a, pretium mauris. Proin eget quam dui. Vivamus luctus tristique justo, et tempor mauris fermentum vitae. Etiam tempor ligula eget laoreet gravida. Proin cursus hendrerit felis, ut laoreet justo auctor non. Aliquam erat volutpat. Cras ac magna id ipsum ultricies pharetra iaculis ut justo.</p>\r\n</section>  \r\n</div>\r\n<div class="glow">\r\n<div class="bg-mision">\r\n</div>\r\n</div>\r\n<div class="bg-lines"></div>', 'block-mision', 'full_html'),
(3, '<div class="row">\r\n<section class="twelve columns">\r\n<h1>Visión</h1>\r\n<p>Cras quis sagittis lorem. Donec nec porta quam, sed condimentum purus. Sed nec ante ac nibh congue elementum. Etiam vitae orci non quam pretium elementum sit amet ac dui. Cras laoreet faucibus risus, vel sollicitudin orci vulputate ut. Praesent ut eleifend arcu. Proin placerat justo dolor, vitae congue nunc malesuada sit amet. Sed sit amet libero a quam facilisis condimentum. Nullam eget arcu molestie tellus eleifend varius. Cras a nibh odio.</p>\r\n</section>  \r\n</div>\r\n<div class="glow">\r\n<div class="bg-vision">\r\n</div>\r\n</div>\r\n<div class="bg-lines"></div>', 'block-vision', 'full_html'),
(4, '<ul class="side-nav">\r\n<li><a id="cre-port" href="#creacion-portafolios"><span class="lsf-icon-dropcap" title="album"></span>Creación de Portafolios de Inversión Inmobiliaria</a></li>\r\n<li><a id="dis-obra" href="#diseno-obras"><span class="lsf-icon-dropcap" title="pen"></span>Diseño y Gerencia de Obras</a></li>\r\n<li><a id="alq-temp" href="#alquiler"><span class="lsf-icon-dropcap" title="calender"></span>Alquiler Corta y Larga Temporada</a></li>\r\n<li><a id="admin-prop" href="#admin"><span class="lsf-icon-dropcap" title="bookmark"></span>Administración y Gerencia de Propiedades</a></li>\r\n<li><a id="vent-nac-int" href="#ventas"><span class="lsf-icon-dropcap" title="globe"></span>Ventas Nacionales e Internacionales</a></li>\r\n<li><a id="org-neg" href="#org-agendas"><span class="lsf-icon-dropcap" title="graph"></span>Organización de Agendas de Negocios</a></li>\r\n</ul>', 'menu-servicios', 'full_html');
